#Finds the reverse compliment of a DNA string
def reverse(dna):
	sLen = len(dna)
	comp = ""
	dict = {'A':'T', 'T':'A', 'C':'G', 'G':'C'}

	#Builds complimentary pairing
	for i in range(sLen):
		if(dna[i] == 'A'):
			comp += dict['A']
		elif(dna[i] == 'T'):
			comp += dict['T']	
		elif(dna[i] == 'C'):
			comp += dict['C']
		elif(dna[i] == 'G'):
			comp += dict['G']
	
	#Return 3' to 5'
	return(comp[::-1])

assert reverse('AAAACCCGGT') == "ACCGGGTTTT"
assert reverse("") == ''
